REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (34,'Brynn Applegath','British Columbia','Athlete','Alpine Skiing',15,'167.64','68','Sun Peaks Alpine Club','Bill Rublee, Wade Rettie, Ben Macgregor',NULL,NULL,NULL,'At these games, I am really looking forward to enjoying the sport I love at a high level of competition. It is going to be a great checkpoint to see what my competition is, and a reminder of what it takes to be successful. My goals are to ski how I know I can and have the most fun I can. I would really like to make the flips because I am unsure of how my placings will be.','Winning first place in my provincial race series.','U16 and U14 excellence 4 years in a row for Sun Peaks Alpine Club, McSporties Athlete of the year award, Academic/effort/honour roll since grade 8, above 95% average award.','Every day I think about how much stamina Mikaela Shiffrin and Serena Williams have. They are the type of strong women I want to grow into. I want to be strong and empowering just like they are for me.','Most of my family from both sides has done ski racing at a young age, but it is my dad who skied on the Canadian National Ski team. It was because of his knowledge of the sport that I started at a young age and fell in love with it.',NULL,0,0,0,0);
