REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (105,'Emma Beach','Newfoundland and Labrador','Athlete','Artistic Swimming',16,'154','57.4','Sea Stars synchro club','Shannon Driscoll and Alicia Vey','Soloist Duet partner and team member','NP','NP','My goal is to proudly and strongly represent my province as best i can and make Newfoundland proud.','My personal best result is a 66.7 in free solo event','I have received many medals for all events in Artistic swimming. multiple gold, silver and, bronze medals and also receiving the award for most dedicated athlete 3 years in a row.','Alicia Vey has been my swim coach for over 5 years now, she has taught me everything from how to be a better swimmer, to how to be a better person. she is one of the most important people in my life to me and i would be nothing without her.','Once at a swim birthday party at my friends when i was 9 years old, some artistic swimmers had practice while we were eating cake. i fell in love with the way they moved and how much grace they had in the water. I asked my mother if i could join and 2 months later i was swimming with summit synchro in mount pearl. I''ve stuck with the sport almost 8 years now.',NULL,0,0,0,0);
