REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (177,'Zachary Blakely','Alberta','Athlete','Gymnastics',19,'173','73','Thunder Country Trampoline/Phoenix Gymnastics','Ken Soehn, Trish Quinney','Trampolinist','"N/A"','"N/A"','To enjoy the entirety of the competition, experience new things, watch other great athletes compete, and perform to the very best of my abilities. And just put out a good show when competing.','Scoring 102.6 at 2018''s National Championships in the senior category.','I have won provincials in several categories as I competed through the years. I won the Indo Pacific Championships in 2016 competing against several different countries. And I had the opportunity to represent my country in several different competitions all over the world, from New Zealand to Bulgaria.','I don''t think I have one specific role model in my life. I have had the opportunity to have a ton of great people in my life who''ve helped me become a better person. From my parents, my close friends, the people I train with, to my coaches. Every one of them has helped me gain a better grasp of how to be the best version of myself.','It started out as a way for my mom to get me out of the house as I was always a handful to deal with (I still am sometimes). Exercise and sport have always been an outlet for me as I grew up, it kept me fit and healthy, it gave me a social circle where I built friendships upon, and it gave me a sense of accomplishment. It still also helps me be more manageable to my mom, so the original purpose is still there.',NULL,0,2,0,2);
