REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (237,'Owen Brawley','Ontario','Athlete','Figure Skating',18,'182','79','KWSC','Kris Wirtz',NULL,NULL,NULL,'Our goals for the games are to continue our strong season and have two great skates in Red Deer','Our personal best this season was at the North American series competition in Milwaukee, we had an overall score of 107.56','We received the True Sport Award 2018','My personal role model is Dylan Moscovitch. He is a great ambassador for Pairs figure skating and figure skating in general, Dylan inspired me to try pairs skating','Dylan Moscovitch was a family friend who suggested I try out the sport of figure skating. He began coaching me at the age of 11.',NULL,0,0,1,1);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (238,'Emma Brearley','Ontario','Athlete','Snowboard',13,'164','58','The Senders','Sam Marcotte, Andy Stewart','member',NULL,NULL,'My goals are to have a national experience in sport, make new friends, and snowboard in another province! I am always looking to progress in my sport and this is a great opportunity to experience snowboarding at a National level.','I came 1st at provincials in my age category for the 2018 season. As well, I was chosen as part of the team to compete at the Ontario Winter Games last season.','I am and active member of my school community. I have been awarded the Community Award at school - for contributions to the school, student council etc. and also the Erin Bickle award for going beyond expectations to help out with specific younger students. I am also currently my school''s Prime Minister. I am also an active member of Wake Canada. I compete in the sport of wakeboarding. I have worked hard and competed and placed in both boat and cable competitions locally, provincially (Ontario) and nationally.','My role models are girls who don''t fit in the box. Those who try new things or do "non-traditional" girls sports/activities. I like to girls who are involved, those who don''t sit on the sidelines but get in there!','I have always had a love for the outdoors. My family spent a lot of my earlier years canoeing, hiking, snowshoeing, and camping. We were outside at all times of year. I started to ski when I was about 3 but quickly moved on to a snowboard. I had and still have a definite competitiveness which led me to try and compete in local competitions at an early age. I started training with The Senders about 3 or 4 years ago and have been working on progressing ever since. I can be competitive and be outside!',NULL,0,0,0,0);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (239,'Liam Brearley','Ontario','Athlete','Snowboard',16,'167','55','The Senders','Sam Marcotte, Andy Stewart','member',NULL,NULL,'My goals for these games are to meet people who have passion for sport, make new friends, have a great life experience and of course do what I love, snowboard! Being that it is set up like a mini Olympic event I think it will be amazing to meet people from other provinces both in my sport and in other sports. I have such a passion for sport and it will be awesome to meet others with a similar passion. My overall snowboard goal is to put down the best run I can on the course. Competition will be stiff but we have a comraderie in Slopestyle and we support each other, encouraging each other to do our best.','Results are all in perspective and progression and experience is key, but coming 1st at the Canadian Air Nation Sun Peaks Slopestyle stop last year was pretty cool. Everyone rode so well so it was up in the air to the placements. One of my teammate''s was recording my reaction without me knowing it. I was completely surprised and ecstatic. After my 2018 season I earned my way to the Junior World Snowboard Championships in Cardrona, New Zealand. This was an amazing experience and placing 19th at the Junior World Snowboard Championships was quite an accomplishment for me. Last year''s (2018) work and results placed me at 9th in Men''s Slopestyle in Canada and 54 in the World. These are my best results so far!','I have earned awards and honours in Snowboarding, Wakeboarding, and Dance. In snowboarding I was named to the NextGen Slopestyle team for 2019. This has been amazing - with opportunities to travel and compete nationally and internationally. It is an honour to be part of this team as well as my home team - The Senders. I also participate in competitive wake boarding. Most recently I participated in the Wake Park World Championships this past Fall where I came first in my age division. I was also an honour student in my first year of high school and have been recognized for community involvement at various times.','I admire many riders from many places as they all have things to offer and teach me by watching them and in some cases meeting them. Of course our Canadian National team - Mikey, Tyler, Mark, Seb, Max, Darcy, Spencer, Laurie, Brooke, are all talented and admirable. I really, really admire Mikey Ciccarelli He has amazing style and is a great, great rider. He grew up in Ontario, riding the same parks, and started on the same team (not at the same time) with some of the same coaches as me. I can relate to Mikey. We both lost of dad''s (and therefore a big part of our support systems) to cancer as we were/are progressing in snowboarding. Watching him and his career- I feel like I can do it, no matter the obstacle. Someone once told me - When life throws you obstacles, bring your board.','As a child I was very active. My family spent time outdoors in all seasons. We canoed, hiked, camped, snowshoed - lots of different activities. I gravitated to sport that was a bit more high risk from an early age and my parents figured they should at least let me learn some skills ''cause I was going to do it anyway! I happened to meet a Senders coach when I was 8 and was presented with the opportunity to train with The Senders from that early age. From day 1 I have been dedicated and so has my family. It gives me an outlet for creativity, energy, and competition. Sport is a passion for me. I can''t imagine what I would be doing without sport!',NULL,0,1,0,1);
