REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (330,'Aly Carter','British Columbia','Athlete','Ringette',17,'163cm','57kg','Thompson Okanagan Ringette League','Kelly Taylor','Forward','alycarter27','alycarter27','My goals for the games are to be able to perform at my best for every game that we play and to experience as many different sports as we can while we are there. That my training and past experience will play off during the games.','Making the CWG ringette team because it is the highest level of competition to play at in our age group. Also winning provincials to become Team BC in the past years.','MVP''s, Most Versatile, Most inspirational, Hardest Worker, Captain in 2017','My personal role model is my mom because she is the hardest worker I have every met and she taught me that you can achieve anything you are passionate about if you are willing to work for it. She set multiple world records in her sport when she was competing at my age for target shooting.','I started Ringette because my dad played university hockey and wanted me to learn how to skate at an early age. Some of our friends were going to join so we did too and my whole family fell in love with the sport right away.',NULL,0,0,0,0);
