REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (332,'Katie Carter','British Columbia','Athlete','Ringette',17,'173','66',NULL,'Kerri Lucas-West','Defence',NULL,NULL,'To win and play some of the best games of ringette I''ll ever get to experience. I can''t wait to see my team really come together and give it all we''ve got. Also I''ve heard that there''s something about karaoke and I am already picking songs.','Getting to compete every year at Ringette Nationals against teams from across the country and trying to prove that our province is the best. Also, making the CWG team was definitely a highlight.','I''ve made teams and won awards and traveled all over, but the best honour I''ve ever received was getting to make new best friends through sport and playing with and getting trained by some of the strongest women in the world.','My mom. She''s the coolest most loving person ever and I get to call her my mother.','My older sister played ringette and my older brother played hockey so I spent the majority of my childhood in arenas and surrounded by ice. I had been learning to skate since the age of two, but the year I turned four I joined ringette and I haven''t stopped since.',NULL,0,0,0,0);
