REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (461,'Hannah Coyne','Alberta','Athlete','Ringette',18,'172','65','Calgary U19AA Rogue','Murray Pettem','Goalie','@hannahcoyne31','@hannahcoyne31','My goal for the games is to work with my team every step of the way and win the gold for my province. It''s not everyday you get to be in such a unique competition in your home province so I will have to make the most of it and work as hard as I can.','I have had the opportunity to place 3rd at nationals twice in my career and placing 1st in provincials three times.',NULL,'My personal role model would be my cousin Emily Dressel. She does not play ringette, but she is an athlete on the national underwater hockey team. Ever since I was a kid I have always strived to be the as driven and passionate about my sport as she for hers. She has always been an amazing role model, by being able to balance school with her sport as well as being an amazing human.','I had a close family friend who played ringette so I tried it out for a few years and I fell in love with the game. I started off like any other player trying all positions but then I found my calling as a goaltender and I''ve never looked back.',NULL,0,0,0,0);
