REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (468,'Jessica Lynn Cranton','Nova Scotia','Athlete','Figure Skating',27,'165.10',NULL,'Greenwood Figure Skating Club','Cheryle Gaston',NULL,'queenjessskates','queenjessskates','My goal is to hit podium in Level 3 ladies and to support my team mates as they pursue their goals.',NULL,'I was chosen to be the MK blade (a international figure skating blade compnay) Ambassador for 2019','The children I skate with at my rink Greenwood Figure Skating Club and St Margarets Bay Centre. I am inspired everyday by them and they have been some of my biggest supporters they have looked past my differences and made me a part of their family. I have cheered just as hard for their victories as they have for mine they have also been there for me through the setbacks. No matter how I’m feeling when I step on the ice weather it’s at my home rink or my secondary rink I have been so lucky to be included and that has been a inspiring and powerful thing.','My Nana Jean and My Grandmother Betty both were big parts of what inspired me to start skating and to work so relentlessly to reach my dream. Without them to push me I would have never found skating or my skating family. They both are no longer physically with me but I feel their spirit every time I step on the ice. I lost my Nan post 2015 games and I lost my Gram Betty right before a big Competition in September I’ve been inspired by their grit and determination that they imparted to me to fight for my dreams.',NULL,0,1,0,1);
