REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (498,'Jaime Czarkowski','Alberta','Athlete','Artistic Swimming',15,'165 cm','54 kg','Calgary Aquabelles','Jenn Tregale, Jaime Thompson',NULL,NULL,NULL,'My goal is to enjoy the whole games and have fun. I want to meet new people from different sports from across the country. Within my sport, it is my goal is to get onto the podium, as well as to swim united with my team and be proud of our swim at the end of the competition.','I''ve placed first at many provincial competitions in figures and team events. In 2017 at Canadian National Championships my team placed 1st and I placed 1st in figures. In 2018 at Canadian National Championships my team placed 3rd. Against most of the world at the 2017 Mediterranean COMEN Cup our team placed 5th and I placed 45th in figures out of 200 and more.','I''ve won the Synchro Alberta 13-15 Athlete of the Year in 2018, I was National Champion in 2017 in the figures and team event. I''ve been the recipient of the John Currie Sport Bursary (2018), the Podium Alberta Sport Grant (2018), the Calgary Booster Club Bob Freeze Grant (2017), and the Beautiful Homes Sports Bursary (2017).','Halle Pratt','My neighbor who is a few years older than me did synchro. She was exceptional at this sport at such a young age and so she inspired me to get involved and join the sport, so I did!',NULL,3,0,0,3);
