REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (628,'Landon Duquette','Nova Scotia','Athlete','Gymnastics',18,'177.8','63.5','Halifax Alta Gymnastics Club','Dave Kikuchi',NULL,NULL,NULL,'My Goal for the Games is to have fun and an over all great experience at my first ever multi sport event. I hope to meet lots of people from all around the country, make new friends and have one of the most memorable competitions of my career.','In my sport, my personal best individual result would be placing 6th in the apparatus final for Pommel Horse at the Canadian Artistic Gymnastics Championships in 2018. As a member of a team, my personal best placement is 3rd in the country, in the team event at the Canadian Artistic Gymnastics Championships in 2018 as well.','I recently received the Lieutenant Governor''s Award of Education in May of 2018.','My role model within my sport is Ellie Black, she is a two time Olympian and World Silver Medalist. I have the privilege of training by her side almost every day, and she is an absolute inspiration to me. Ellie is proof that no matter where you come from, whether it be big or small, anything is possible with hard work and determination.','I first started in soccer at a young age, but was constantly doing cartwheels and gymnastics skills on and off of the field. My parents saw that I definitely had an interest for flipping around and the next year put me in gymnastics. This was at the same time as the 2008 Olympic games where I first saw gymnastics on TV and knew right away that it was a sp