REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (776,'Shirine Gauvin','Quebec','Athlete','Artistic Swimming',16,'166',NULL,'Québec excellence synchro','Geneviève Mercier','Natation artistique -réseau performance',NULL,NULL,'Avoir la médaille d''or pour les épreuves en équipe.','J''ai remporté la médaille d''argent en duo et celle de bronze en équipe aux championnats PanAméricain à Santiago de Chili.','Athlète de l''année du Québec en 2011 et 2013.','Sylvie Fréchette, car elle s''est rendu au plus haut niveau en natation artistique et malgré toutes les épreuves personnelles qu''elle a du surmontée, elle n''a jamais perdu la passion et n''a jamais renoncer en ses rêves. Ces donc entre autres pour ces raisons que je l''admire beaucoup.','Dès un très jeune âge, on m''appris à nager. Je passais alors de nombreuses heures à jouer dans la piscine et mes parents remarquèrent le plaisir que j''avais à aller chercher des anneaux dans le fonds de l''eau. Ma mère m''as donc inscrite à des cours de nage synchronisée et j''ai tout de suite eu la piqûre.',NULL,0,1,0,1);
