REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (778,'Jay Gegner','Saskatchewan','Athlete','Archery',17,'173','61.69','Frontier Bowmen','Sherman Brown',NULL,NULL,NULL,'First of all, to have fun and experience the atmosphere of such a large sporting event, as well as to cheer on my fellow provincial teams. I also want to achieve medal ranking, and see my years of hard work show themselves in my ranking.','My personal best score while shooting indoor is a 267, and I have achieved numerous gold medals province-wide.','None.','My two club coaches, Mike Kupchanko and Keith Partridge. These two men have given countless hours coaching myself and numerous other members of our club. They are constantly giving back to the community and the sport by teaching budding young archers how to shoot, and they have made a huge impact on both my archery career and on my life as a whole.','Keith Partridge met me at a learn-to-shoot program, which I was attending for fun with my dad. Keith saw my potential even as a much younger shooter and encouraged me to pursue archery more seriously. He coached me towards a more competitive path and helped me get to where I am today.',NULL,0,1,0,1);
