REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (861,'Natalie Greenfield','Alberta','Athlete','Artistic Swimming',16,NULL,NULL,'Calgary Aquabelles Synchronized Swimming Club','Jenn Tregale',NULL,NULL,NULL,'My goals for the games include performing at my personal best, to help Alberta in achieving a podium finish and meeting new friends from all across the country.','I have placed first at Nationals and Provincials multiple times in the past.','12 and Under Provincial Athlete of the Year',NULL,'When I was young I took swimming and dance. At the pool where my swimming lessons were, a synchronized swimming team would train. After my swimming lessons were over I would sit on the side of the pool and watch them. It inspired me to want to try this sport. Synchronized swimming balanced out the two activities I loved most, dance and swimming, so I stuck with it and have never looked back.',NULL,1,0,0,1);
