REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (865,'Janna Griffioen','Ontario','Athlete','Ringette',19,'170','170','McMaster Marauders','Carrie Hartley','Goalie',NULL,NULL,'My goal for the games is to soak in the atmosphere of this once in a lifetime opportunity. My teammates and I have worked hard to be where we are and I''m really excited for us to perform at our best in this event.','My personal best result in ringette would be winning two national championships. Being able to train and compete with a group of girls so dedicated and focused on a common goal allowed me to create a greater appreciation for the game.','At the 2018 Canadian Ringette Championships I was named on their all star line, an award given to an athlete who was scouted for exceptional play throughout the competition.','My personal role model is my dad, Doug Griffioen. I have yet to meet such a selfless and kind person. Like many parents of athletes, he was my personal chauffeur and number one fan for many years, though he was starting his own business the time I started tying my own skates. With a busy work schedule, my dad always made a point to not look on his phone or laptop during games to be fully present to support. Though I appreciated having a fan at the time, I can now look back in awe of the amount of dedication he put in to encourage me and allow me to pursue my passion.','A family friend invited me to skate on a snow day and I never stopped.',NULL,0,1,0,1);
