REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (982,'Chantel Suzanne Hoag','Saskatchewan','Athlete','Curling',15,NULL,NULL,NULL,'Patrick Ackerman','Second',NULL,NULL,'My goal for the Canada Winter Games is to perform to the best of my abilities and medal with my best friends at a national event once again. I want to learn from the experience and grow as a curler and person. I wish to have fun with my teammates and make new friends from across our great country.',NULL,'I was honoured to receive the Fair Play Award chosen by the officials at the U-18 curling Nationals.','I have many role models in my life and in my sports and passions. I have been blessed with an incredible family who support me in all aspects of my life and who I look up to in whatever I may be doing. In curling, Joanne Courtney has always been a huge inspiration to me, as her sweeping abilities are something that I aspire to have. My karate sensei (instructor) is also a huge mentor in not only karate, but in life. I find myself many times following his inspiring advice through the course of my life.','My family is a very curling driven family, hence my involvement in the sport. I grew up watching my sister and parents curl in rinks all across Saskatchewan. My passion only grew with every new rink that I followed them to. I feel so blessed and fortunate to be able to follow in my family’s footsteps and contribute to the sport of curling.',NULL,0,0,0,0);
