REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1044,'Rhys James','Alberta','Athlete','Cross Country Skiing',19,'187','86','Foothills nordic','Eric G',NULL,NULL,NULL,'To ski fast and represent alberta','11th at Canmore nationals',NULL,'Xavier Mckeever because he is a legend in the sport.','Through foothills nordic',NULL,0,0,0,0);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1045,'Lyndsey Janes','Alberta','Athlete','Hockey',17,'162.56','67.1317','Notre Dame Hounds','Craig Perrett','Right Wing','LyndseyJanes','LyndseyJanes','My goals for the games is to learn from all the amazing athletes, coaches, and mentors around me and of course win a medal! This is an opportunity of a life time and getting to play along side all these amazing athletes is an honour. I want to use every bit of it of this opportunity to learn so that I can help my team win that Gold medal.','My personal best result in my sport is making it to the 2019 Canada Winter Games. Getting the opportunity to play at such an elite level is the best reward I have ever receive from the sport yet and It is an honour to represent my province while doing what I love.',NULL,'My role model is my former teammate Abbey Nimegeers. I got the pleasure of being able to play on the same team as Abbey for two years, and in those two years I learned so much about what it takes to be a great leader. She was the teammate that made others better. Abbey inspired me every single day on and off the ice and she continues to do so as she continues with the adventures life has brought her. I can confidently say Abbey is someone who has helped me get to this point in my hockey career and I wouldn''t have been able to do it without her leadership and support.','I got introduced into hockey by my little brother Kevin. As a kid I loved to be active and play sports. I started playing hockey when I was 9 years old and I immediately fell in love with the game. At the beginning I didn''t even know how to stop, but lucky I had Kevin there to teach me. The feeling of excitement and happiness that the game brought me at such a young age was something special and I knew from that moment on that it was the sport for me.',NULL,1,0,0,1);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1046,'Claudia Janvier','Quebec','Athlete','Artistic Swimming',15,'5,4','110',NULL,'Laura Swift','natation artistic/ nage synchronisée',NULL,NULL,'Permormer le mieux possible et d''avoir une bonne expérience.',NULL,'Deux médailles d''or au pan am championship et le Barbara Stewart trophy','Audrey Joly qui est maintenant sur l''équipe national senior car elle s’entraînait à mon club avant quelle soit sélectionné et j''ai pu voir tout les efforts quelle a du faire pour avoir des résultats et bien sur tout mes coachs car ils sont toujours là pour m''aider et ils croient toujours en moi.','Depuis que je suis petite, j’ai toujours aimé le sport et les compétitions. Je faisais de la natation et le ski alpin compétitif jusqu’à l’âge de onze ans. J’ai commencé à faire de la nage synchronisée à l’âge de huit ans, je n’aimais pas tant ça, mais j’ai quand même continué, car ma sœur et ma mère voulaient vraiment que j’en fasse, et puis c’est à l’âge de seulement dix ans que j’ai commencé à faire des compétitions dans le réseau national et dans une catégorie 13-15 ans. C’est là où je suis vraiment tombé en amour avec la nage synchronisée, c’était rendu plus que juste mon sport, c’était ma passion.',NULL,0,1,0,1);
