REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1164,'Kiara Kroetsch','Saskatchewan','Athlete','Artistic Swimming',13,'157','43','Saskatoon Aqualenes','Laurie Wachs & Elise Marcotte',NULL,NULL,NULL,'To enjoy the experience, be in the moment, and swim to the best of my ability.','Gold','Most Dedicated Provincial Stream Athlete - 2016 & 2017',NULL,'I started doing artistic swimming at age 7 because I loved to swim, dance, and do cheerleading and it combined the best of all worlds.',NULL,0,0,0,0);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1165,'Adora Kruger','Alberta','Athlete','Artistic Swimming',18,'170','60','Calgary Aquabelles','Jenn Tregale',NULL,NULL,NULL,'My goals for the games is enjoy the games to the fullest extent, and swim as a united team. When we swim I would like to us leave the impression that we have been swimming as this team for years, even though in reality we have only been swimming as this team for the past couple of months. Although podium would be nice, I would like us to have our best swim during the competition.','I have had the most amazing experiences which have allowed me to come first in many Provincial competitions in team, duet and combo. My overall personal best was in 2017 when my team and I came first in both team and combo, and my duet came seventh out of the whole country.',NULL,'My personal role model would be my Aunt Audri. Audri is the most caring genuine individual I have ever met in my life. She would always help those around her without asking for anything in return even if it consumed lots of her time and energy, as well as encourage everyone to follow dreams and not listen to the negative perspectives others have on your decisions. Having a role model like her in my life has allowed me to follow my dreams and passions in life. It was because of her I am still doing what I am passionate about and following my long dream of representing Team Alberta, swimming in the Canadian Winter Games.','I became involved in the sport because my mom was a synchronized swimmer growing up. She had the most amazing experiences swimming, it allowed her to make friends for life and gave her amazing opportunities to travel the world and gave her special tools to succeed later in life. She encouraged me to swim, so I could have the same friendships and experiences as she did swimming.',NULL,1,0,0,1);
