REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1216,'Sophie Lapointe','Quebec','Athlete','Judo',14,'157 cm','46kg','Club Judokan','Hugues Tremblay',NULL,NULL,NULL,'Mes objectifs pour les Jeux du Canada sont : obtenir la première place, malgré que je sois dans les plus jeunes de ma catégorie. J’espère pouvoir relever ce défi. Mon deuxième but est de bien me battre, et de gagner de l’expérience. Je souhaite être satisfaite de mes performances. À la fin de la journée, ce n’est pas la médaille qui compte, mais le fait d’avoir participé et d’être satisfaite de mes combats.','Mon record personnel est la compétition qualificative pour les jeux du Canada, plusieurs mois avant la compétition. J’ai été informée par mon coach Hugues Tremblay que cette année j’allais avoir la possibilité de me qualifier pour les Jeux du Canada. J’ai tout de suite sauté sur l’opportunité qui m’avait été donnée. Ma préparation mentale allait être critique pour cette compétition car, je connaissais très bien mon adversaire et je ne l’avais jamais battue auparavant. Je me suis fixé un but. Je voulais vraiment participer aux Jeux et finalement gagner contre mon adversaire. Quelques semaines après avoir commencé ma préparation physique et mentale, j’ai appris que Judo Québec amenait l’équipe du Québec des jeux du Canada en France pour un tournoi et un camp d’entraînement préparatoire avant les Jeux du Canada. Ma motivation pour gagner la qualification a tellement augmenté, je n’ai jamais été aussi motivée d’atteindre un but fixe. Je pensais seulement à la compétition (de qualification) à Québec. Je parlais du voyage en France et des jeux chaque jour. Je me suis mise beaucoup trop de pression et cela a paru. Une semaine avant la compétition, j’ai commencé a vraiment ressentir le stress, je le savais que je ne pouvais pas avoir de doute rendue sur les tapis et qu’il fallait que je reste concentrée pour atteindre mon but. Malgré toute ma préparation, un soir, après un entraînement de judo j’ai cassé sous la pression que je mettais sur moi-même. J’ai ressenti la fatigue et l’épuisement physique et mental de tous les entraînements qui étaient supposément ma préparation pour Québec, mais à ce moment précis cela me détruisait. Heureusement ma mère et mon père ont été à côté de moi pour m’aider à passer au travers. Rendue à la compétition, j’ai pu avoir le bon état d''esprit. On pouvait ressentir le stress dans l’air au site de la compétition. Je n’étais pas la seule à vouloir faire les Jeux. Je n’ai jamais été aussi concentrée pour un combat de ma vie. J’avais un but et c’était de me battre pour moi-même et de me prouver que j’étais capable d’atteindre mes buts, si je le voulais. J’ai gagné mes deux combats et mon adversaire a refusé le combat de barrage, donc j’étais automatiquement qualifiée pour les Jeux du Canada et le tournoi de préparation en France. Cette compétition m’a extrêmement marquée. Je sais maintenant qu’il est important d’être prête pas seulement physiquement, mais aussi mentalement.','Prix élite Côte-Nord JUDO URLS 2018
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1217,'Darcie Lappan','Ontario','Athlete','Hockey',17,'170','70.30','Kingston Jr Ice Wolves PWHL','Troy Sweet','Forward',NULL,NULL,'My goal for the Canada games is to play each game to my fullest potential and help my team win the gold medal.',NULL,'It was a great honor, being given the opportunity to be a member of the Team Ontario Blue team at last years National Women''s U18 Championship in Quebec City.','Clara Hughes','My family have been long time hockey players and when I was two years old I tried on my first pair of skates and never looked back. I started by learning to skate on our backyard rink that my family makes every winter. At the age of 4, I started playing at my local rink and later switched to the girls Rep program in Kingston under the Ontario Women''s Hockey Association. Growing up playing in this league has allowed me to develop my skills and play against high level opponents. OWHA has taken tremendous strides in developing girls hockey and has allowed me to participate in the U16 High Performance Camps, U16 Ontario Summer games, U18 High Performance Camps and the U18 National Women''s Team Ontario Blue Team. These opportunities have helped me develop a greater skill set as it has provided me with high level coaching and allowed me to compete against the best athletes. Overall I have enjoyed playing my minor hockey with OWHA.',NULL,0,0,0,0);
