REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1537,'Paige Miller','Ontario','Athlete','Ringette',18,NULL,NULL,'U19 AA Guelph Predators',NULL,'Forward','paige_sg','paige_sg','For ringette players, the Canada Winter Games truly resemble the Olympics, since ringette isn''t in the Olympics. For this reason, it is important to me that I take in the whole experience. My team and I intend to perform our best, leaving with absolutely no regrets. We are going for gold!!','Winning the Ontario Winter Games with my Eastern Ontario AAA team in March 2018 was the biggest accomplishment I have had in my ringette career thus far.',NULL,'My role model at the moment is Ellen Degeneres. Ellen always helps those in need and makes people laugh. I aim to always make people happy, regardless of the mood that they are in.','I grew up playing Timbits hockey, where I was the only girl on my team. When I heard of the sport of ringette, which is all girls, I instantly switched from hockey and fell in love with it. My dad has been my coach since 2006 and has pushed me to continue to work hard, which has brought me here to the CWG!',NULL,0,1,0,1);
