REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1685,'Rachel O''Toole','Manitoba','Athlete','Hockey',17,'177','63.5','Westman Wildcats Midget aaa','Guy Williams','Defence','@rachelotoole4','@rachelotoole4','My goals for the games are to compete at the highest level,
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1686,'Ilhem Ouali','Quebec','Athlete','Judo',17,'166cm','66kg',NULL,NULL,NULL,NULL,NULL,'Mes objectifs pour les Jeux du Canada seraient de bien performer au sein de mon équipe sportive. Je tiens à me démarquer dans ma catégorie puisque je sais que j''ai des adversaires de taille. Gagner la première place serait une réussite personnelle, cela voudrait simplement dire que toutes mes dures heures d''entraînement auraient porté fruits.','Mon plus grand record personnel est le championnat canadien 2017, j''avais enfin réussi à avoir l''or, je dis << enfin >> puisque j''avais été deux fois vice-championne les années précédentes. Mais encore, aujourd’hui, je pense que ce n''est pas un grand record puisque c''est juste une compétition nationale. Je pense que le meilleur est à venir et j''espère pouvoir me rendre encore plus loin. Enfin, c''est sûrement ma détermination et mon acharnement à vouloir réussir qui me permettra de réussir dans mes objectifs de vie.',NULL,'Bien que plusieurs diront que c''est leur coach qui les inspire, ou certaines célébrités dans le sport, moi, je serais plus porté à dire que c''est avant tout mes parents qui m''inspirent. Je pense bien que je leur dois toutes mes réussites. Ils ont su me remonter le moral lors de mes défaites et répondre à mes questions pendant mes périodes de doutes. Ils m''ont surtout initié à ce sport et sans eux, je ne serais probablement pas rendue là. Ils ne sont pas juste mes modèles ou mon inspiration, ils sont d''abord et avant tout ma source de motivation.','Grâce à mon grand frère qui en faisait avant moi, j''ai commencé le judo. Étant petite, je voulais tout faire comme lui; mes parents m''y ont inscrit aussi. J''ai fait plusieurs sports, mais le judo est resté une passion pour moi. J''ai donc fait abstraction des autres sports pour pouvoir me donner corps et âme à ce sport, qui aujourd''hui prend beaucoup de place dans ma vie.',NULL,0,1,1,2);
