REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1870,'Emily Rogowsky','Manitoba','Athlete','Judo',16,'165','54','Balmoral Judo Club','Jason Rogowsky',NULL,NULL,NULL,'I would like to gain experience and learn new skills, and also make friends at the games.','1st place at Manitoba Provincials in 2017.',NULL,'My personal role model is my coach and dad, Jason Rogowsky.','I started judo at the age of 7 because my dad was one of the coaches.',NULL,0,0,0,0);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1871,'Liza Roik','Ontario','Athlete','Ringette',19,'175',NULL,'Richmond Hill Lightning NRL',NULL,'Forward','LizaRoikkk','LizaRoikkk','My goal for the games is to give my all and compete at my best alongside my teammates. Collectively, our goal is to win gold but to have fun and enjoy the experience along the way. I am excited to be able to represent my province and compete with some of the best athletes in the country.',NULL,'Fastest Skater Award at the 2013 Eastern Canadian Ringette Championships','My personal role model is my mom. She has supported me throughout my ringette career and played a crucial role in helping me develop the skills I need to be successful in all areas of my life. She has shown me what it means to be selfless and kind and to give my all in everything that I do. She always tells me "You can do anything you put your mind to" and thanks to her, I have learned that anything is possible as long as you''re willing to put in the work.','Coming from a family of athletes, I always knew I would end up being involved in sports in some shape or form. Both of my brothers chose to pursue hockey but being the only girl in my family, I wanted to find my own passion and I knew hockey wasn''t right for me. I tried every sport imaginable but it wasn''t until age 7 when I heard about ringette through a friend of a friend that I knew I had found the one for me. I love the speed, the finesse and the teamwork involved in the game and I plan to continue playing for many years to come.',NULL,0,1,0,1);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1872,'Gabriele Romano','Alberta','Athlete','Gymnastics',15,'5''5','120 LBS','Calgary Gymnastics Club','Coach Salvador Garcia','Male Artistic Gymnist',NULL,NULL,'Gymnastics has allowed me to travel and compete and meet people from so many places. I learn as much from each tournament as I do from each coach, competitor and team mate. During these games, I would like to medal on an event and I look forward to meeting other Athlete''s. I am very humbled & honoured to be representing Team Alberta at the Canada Winter Games this year.','I came in 2nd all around in Western Canada (Gymnastics)','I have been fortunate to win the Alberta Provincial Championship 3 times and named Top 3 in All Around for Western Canada.
