REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1877,'Matthew Ross','Nova Scotia','Athlete','Boxing',16,'6''1"','69','NEWWATERFORD BOXING CLUB','TYRRA WHITE/ROBERT ROSS/WAYNE GORDON','COACHES',NULL,NULL,'To be competitive and try my best to bring home gold','Winning Nationals in Edmonton','National Championship plus awards from various competitions across the world','My Dad','started boxing just to get in shape and just continued to work harder and harder every year to get where i am today',NULL,0,0,1,1);
REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1878,'Shani Rossignol','New Brunswick','Athlete','Hockey',16,'160','66','Ontario Hockey Academy- juniors','Jenna Lascelle and Adam Scuglia','Center','@ShaniRossignol','@ShaniRossignol','My goals are to help my team bring home the gold medal by going out there and giving 100% in every game and being a team player.','My personal achievements continue to grow. At first it was making the Atlantic Challenge Cup tournament 5 years in a row, then it was when I committed to The Ohio State University for the year 2020 and now it’s going to the Canada Winter Games and representing my province.','I received the hard hat award at the Atlantic Challenge Cup in 2018 and 2017, I also received a hard hat award while playing with the peewee junior cat’s of Grand Falls, NB at the Provincials. When I was younger I got an award for most devoted player and most improved player.','My dad is my role model, it’s because of him that I’m performing the way I am. My dad is the type of man who is independent and never quits, he will start with nothing and makes something out of it. Growing up he always taught me to do the same thing.','When my grandfather passed away it was very hard on me. It was so hard that even after six months went by I was still crying every night, so my dad said that I had to find a pastime to keep my mind off the pain of looing my grandfather. After trying a whole bunch of things, like guitar lessons, kung-fu, etc.. nothing was working. Then one day I went to see my younger brother play a hockey game and I loved it so much that I begged my dad to let me play. His first reaction was to say no because hockey season had already started two months earlier and I had never even put a pair of skates on before. Fortunately I didn''t give up that easy and kept asking him everyday for about a week before he finally decided to cave and let me play. The hockey schedule kept me so busy that it helped me deal with the loss of my grandfather.',NULL,0,0,0,0);
