REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (1883,'Laurence Roux','Quebec','Athlete','Gymnastics',20,'168','58,7','Acrosport Barani','François Leblanc et Julie Dionne','Trampoline',NULL,NULL,'Pour ces Jeux, j''aimerais compléter mes 3 routines en améliorant ma hauteur mais tout en conservant une bonne exécution.','Je performe beaucoup mieux en double-mini trampoline, alors mes récents records personnels ont été établis à cet appareil. De ce fait, j''ai fait mon meilleur score à vie, lors des Championnats du Monde en Russie.','J''ai reçu une bourse de la fondation sport-étude pour mes performances académiques cette année. J''ai également reçu plusieurs bourses de la part du CDESL pour mes résultats dans mon sport ainsi que pour mes résultats à l''école.','Depuis que je suis petite, je n''ai pas vraiment de modèle. Par contre, depuis quelques temps j''en ai appris davantage au sujet de Laurent Duvernay-Tardif, qui est présentement médecin ainsi que joueur pour Kansas City dans la NFL. C''est lorsque je vois des personnes comme lui que je me dis que rien ne peut nous arrêter dans notre quête à la réussite.','Comme cadeau de fin d''année lorsque j''avais 6 ans, mes parent m''ont offert une trampoline. J''ai alors commencé à sauter à tous les jours. Voyant que j''était plutôt casse-cou, mes parents m''ont alors inscrit au club de trampoline de mon école.',NULL,1,1,1,3);
