REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (2084,'Luke Sullivan','Nova Scotia','Athlete','Speed Skating',16,'168','58','Halifax Regional Speed Skating Club','Bethany McKinley-Young',NULL,'@lukesully116','@lukesully116','My goals for the games are to set new PB''s in all of my races, to make the most of my Canada Games experience, and to set an example for the younger skaters back home, so that they realize that if they keep skating, they might be able to end up at Canada Games too in a few years.',NULL,'Speed Skate Nova Scotia Male Athlete of the Year (2017)',NULL,'In Grade 1, I played soccer, but didn''t really like it that much. In one of the soccer flyers that was passed out to my parents, there was an advertisement for a speed skating club, so we decided to try it out. Apparently after my first practice, I had the biggest grin on my face, because I absolutely loved it. 11 years later, I still love the sport as much as I did then.',NULL,0,0,0,0);
