REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (2090,'Ainsley Svetek','Ontario','Athlete','Hockey',17,'5''7','70','Stoney Creek','Stacey Marnoch','Defence',NULL,NULL,'My goals for the game are to enjoy the experience and make the most out of it. It is only a week, but I know that it could be one of the best weeks of my life. Winning gold with Team Ontario would be an honour. Going through the program, they work so hard to ensure we always enjoy our camps and are successful! Winning gold would be an honour!',NULL,'Attending Team Canada Camp, attending and making Team Ontario, Provincial Championships','My personal role model would be my mom. She is hard working and always does what is best for others. She grew up around sports and continually motivates me to be the best athlete I can possibly be while always supporting me through any hard times.','I got involved in my sport at a young age through my siblings. They both played hockey and loved it and I wanted to be just like them. Once I started playing hockey I knew I did not want to stop! Being a female hockey player through the OWHA has given me so many opportunities and room for growth as an athlete and a person.',NULL,0,0,0,0);
