REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (2105,'Seiya Christopher Tanaka-Campbell','British Columbia','Athlete','Hockey',16,'173','70','Shawnigan Lake School Midget Prep','Kevin Cooper','Forward','"N/A"','"N/A"','I want team BC to come out and play without leaving anything behind and hopefully coming out on top as champions.','My best results of hockey is probably making midget prep at Shawnigan Lake School. All summer I worked hard to achieve this, and I was very proud of myself when I made it.','I have received CSSHL student-athlete for Shawnigan Lake School for the past 2 years.','My brother: Jojo Tanaka-Campbell. Born 2 years older than me, he’s someone I’ve admire on and off the ice since the day I was born. I’ve always aspired to be like him; confident, hard working, and a leader in life. He is someone respected by his peers and that is a quality that will help him succeed as he gets older.','5 years ago, my father passed away from ALS. This is the first and only sport he truly taught me. Many of his closest friends have told me that he was the definition of a typical hockey dad. My father started teaching me hockey at the age of 2, and as I gradually became older, I have come to love the sport.',NULL,0,0,0,0);
