REPLACE INTO Athletes(ID,Athlete_Name,Athlete_Province,Athlete_or_Coach,Athlete_Sport,Athlete_Age,Athlete_Height,Athlete_Weight,Athletes_Clubs_or_Teams,Athletes_Coaches_Name,Athletes_Team_Position,Athletes_Previous_Games,Athletes_Previous,Athletes_Goals,Athletes_Personal_Best,Athletes_Awards,Athletes_Role_Model,Athletes_Media_or_Social_Media_Information,Events_Participated_In,Athletes_Number_of_Gold_Medals,Athletes_Number_of_Silver_Medals,Athletes_Number_of_Bronze_Medals,Athletes_Placements) VALUES (2113,'Tiffany Tantakoun','Manitoba','Athlete','Badminton',18,'167.64','134','Winter Club','Justin Friesen','Athlete',NULL,NULL,'To do my best in my category and help take my team do their best.','I''ve placed 1st in women''s single, doubles and mixed','I received the most improved player in 2016. For education wise, I''ve always been on the honour roll. I''ve received the Academic Athlete for the last 6 years.','My mother','I started playing badminton when one of my friends who was already involved in the sport, needed another girl to tryout for the 2015 Manitoba Games. So, I decided to try out and I made the team! Then one of the coaches that was apart of the team approached me and asked if I wanted to join the club team. Here I am now!',NULL,0,0,0,0);
