DROP DATABASE IF EXISTS testDB;
CREATE DATABASE testDB;
USE testDB;

DROP TABLE IF EXISTS Sports_Dates;
CREATE TABLE IF NOT EXISTS Sports_Dates(
   ID           INTEGER  NOT NULL PRIMARY KEY 
  ,Sports_Names VARCHAR(255) NOT NULL
  ,Sports_Times VARCHAR(1500) NOT NULL
);

DROP TABLE IF EXISTS Teams;
CREATE TABLE IF NOT EXISTS Teams(
   ID                  INTEGER  NOT NULL PRIMARY KEY 
  ,Team_Name           VARCHAR(255) NOT NULL
  ,Team_Members        VARCHAR(2500)
  ,Team_Competitions   VARCHAR(1500)
  ,Team_Event          VARCHAR(255) NOT NULL
  ,Team_Contingent     VARCHAR(255) NOT NULL
  ,Team_Final_Position VARCHAR(255)
);

DROP TABLE IF EXISTS Province_Medals;
CREATE TABLE IF NOT EXISTS Province_Medals(
   ID                     INTEGER  NOT NULL PRIMARY KEY 
  ,Province_Name          VARCHAR(255) NOT NULL
  ,Province_Gold_Medals   INTEGER  NOT NULL
  ,Province_Silver_Medals INTEGER  NOT NULL
  ,Province_Bronze_Medals INTEGER  NOT NULL
  ,Province_Total_Medals  INTEGER  NOT NULL
);

DROP TABLE IF EXISTS Athletes;
CREATE TABLE IF NOT EXISTS Athletes(
   ID                                         INTEGER  NOT NULL PRIMARY KEY 
  ,Athlete_Name                               VARCHAR(255) NOT NULL
  ,Athlete_Province                           VARCHAR(255) NOT NULL
  ,Athlete_or_Coach                           VARCHAR(255) NOT NULL
  ,Athlete_Sport                              VARCHAR(255) NOT NULL
  ,Athlete_Age                                INTEGER  NOT NULL
  ,Athlete_Height                             VARCHAR(255)
  ,Athlete_Weight                             VARCHAR(255)
  ,Athletes_Clubs_or_Teams                    VARCHAR(255)
  ,Athletes_Coaches_Name                      VARCHAR(255)
  ,Athletes_Team_Position                     VARCHAR(255)
  ,Athletes_Previous_Games                    VARCHAR(255)
  ,Athletes_Previous                          VARCHAR(255)
  ,Athletes_Goals                             VARCHAR(2000)
  ,Athletes_Personal_Best                     VARCHAR(3000)
  ,Athletes_Awards                            VARCHAR(3000)
  ,Athletes_Role_Model                        VARCHAR(2000)
  ,Athletes_Media_or_Social_Media_Information VARCHAR(3000)
  ,Events_Participated_In                     VARCHAR(30)
  ,Athletes_Number_of_Gold_Medals             INTEGER  NOT NULL
  ,Athletes_Number_of_Silver_Medals           INTEGER  NOT NULL
  ,Athletes_Number_of_Bronze_Medals           INTEGER  NOT NULL
  ,Athletes_Placements                        INTEGER  NOT NULL
);
