81Kg. GOLD MEDALLIST AT THE 2018 BRAMPTON CUP','My Dad, Gil Balteiro who is a former 3x Canadian Boxing Champion and Bronze Medallist at the 1990 World Junior Boxing Championships in Istanbul, Turkey. And my Uncle Alex Balteiro former Canadian Boxing Champion','The reason I started boxing was because I had been inspired by my dad at a young age. Every young kid wants to be just like their dad when they grow up, and I was fortunate enough to have a father that was a great boxer, holding an 86-6 record as an amateur and even receiving Bronze at the 1994 Junior World Boxing Championship in Istanbul, Turkey. Although I started boxing only 2 years ago, throwing punches was nothing new to me. I had been training in my garage every once in a while since I was 9. My dad introduced me to the boxing world by handing me over to his former coach, Doug Patterson. August of 2017 was when I finally had my first fight, I wasn’t familiar with the word composure, leading me to my first loss as a fighter. After learning from my mistakes, I had the chance to compete in the Ontario Silver Gloves where I beat my first opponent by unanimous decision, and receiving the chance to rematch my first ever opponent. Giving my tough opponent 2 eight-counts in rounds 1 and 3 lead me to another unanimous victory. After winning the Silver Gloves it was back in the office and looking ahead toward the next tournament, Golden Gloves. Golden Gloves was my chance to get some provincial exposure, knowing there had been no one in my weight division in the open category I always had hope that the Ontario team would take me into consideration. I fought a great fight and ended up victorious again. Acknowledging that Ontario Winter Games was only 2 months away I trained hard. When I went to the OWG I had to fight an open youth fighter to prove that I was capable of competing at the Super Channel Nationals in Edmonton. After winning another unanimous decision I had finally displayed composure and a high skill level, leading me to my first nationals. I went to Nationals with only 6 fights and fought 1 tough fight against an opponent from Newfoundland. I won another unanimous decision making me 2018’s Junior C National Champion in the Light Heavyweight division. After nationals my coach set up a fight against USA’s National Champion, although he had over 60 fights I stuck right with him the whole 3 rounds. In the end I received my second loss by split decision. After experiencing a fight against a high level fighter I knew what was expected internationally. I trained hard throughout the summer working on my strength and conditioning, but didn’t get a chance to find a fight. The next step for me was this year’s Golden Gloves where I won another unanimous decision against an older, more experienced fighter which now has lead me here at the Canada Winter Games. I am very excited and honored to be competing in the biggest Winter sporting event across the nation. I could not have done any of this without the help and support of my family, Coach Doug Patterson, Fighting Island Boxing Club, and all my local fans. I am truly blessed to have such an amazing support team through it all.',NULL,0,1,0,1);
