Distinction scolaire pour avoir su concilié sport et études depuis mes 12 ans.','Autre que mes parents qui m’inspirent quotidiennement, Muhammad Ali est, à mon avis, l’athlète qui dégage les plus belles valeurs. Humble , travaillant et persévérant sont les mots qui le décrivent le mieux. Étant une personne de couleur, il a dû travailler 8fois plus dur afin d’arriver aux normes, il n’a pas baissé les bras et a su faire de ses échecs des réussites qui l’ont forgé en tant qu’individu exemplaire. Ses phrases inspirantes resteront en mémoire tout le long de ma carrière.','Le judo est une histoire familiale chez nous. L’ensemble de ma très grande famille a eu la piqûre pour ce sport. Étant la plus jeune d’une famille constituée de 3 garçons et moi , j’ai voulu exceller dans le sport comme eux et parmi les trois sports que je pratiquais, judo est celui qui me correspondait le mieux!',NULL,0,0,2,2);
