3. Harley and Doris Poon Award of Outstanding Sportmanship for 2017 and 2018 by Edmonton Chinese Bilingual Education Association (ECBEA).','My personal role model is Kaetlyn Osmond because she is such a beautiful and talented skater.','The reason that I started skating late, at the age of 7, was that I did not know how much fun it would be when skating on the ice. When I was 4, my mother bought a pair of skates (now being used by my little sister) and took me to an ice rink. But I refused to get on ice. Mom asked me again when I was 5 and I said no, and I said no again when I was 6. When I turned 7, my mother took me for public skating with my friend. Finally I got on ice. Later on, my mother skated with me really fast with an on-ice skate aid and I loved the feeling of “flying” on ice. Soon I learned how to skate by myself with a chair during outdoor public skating. Mom convinced me to take skating lessons because she couldn’t teach me how to stop properly on ice. That was how I started skating. Now I really enjoy figure skating. Especially I get to train with top skaters (e.g. Kaetlyn Osmond, Aurora Cotop, Eric Liu, etc.) every day at our club. They are so inspiring!',NULL,1,0,0,1);
