Honesty award','My personal role model is terry fox, forever and ever!','I started out as a competitive gymnast and absolutely hated every minute of every practice. Practices were so long. One day I started crying in the middle of my beam routine, Forcing my mom to remove me to settle me down. I told her how much I hated the sport. She finally agreed to let me stop attending practices.I participated in fitness lessons and outdoor activities to keep my fitness up until I found something to do. My mom brought me to the squash facility where I got to watch the top players in the world. I remember thinking how cool it was for so many people to be watching them and asking for pictures after their practices. So I told my mom to put me. The first couple of lesson weren’t very good, it just made me think a different way of the sport. I wasn’t able to grasp on any skill because my body was so tense from gymnastics. Until the summer of 2013. My family moved to canada, hoping to build a foundation for my brother and I, and to wider opportunity ranges. I joined the beginner class for 3 years until I was 11. I told my mom that I wasn’t being challenged at all and that I wanted to move to the more advanced group where my older brother trains. She talked to my coach, Jonathan hill and he agreed to put me in. I was the youngest and most unexperienced, but that only made me work harder. So, as you can see I started playing competitive squash at 11, ever since joining the group, have supportive teammates, amazing parents, and the best coach, it gave me opportunities to travel around the world and compete under Canada, and now I cannot believe I’m apart of the Canada winter games squash team. It’s such an honour being able to make a team for a big event. I worked my butt off for hours and hours a day to make it to where I’m today. I also have to give credit to my brother for always pushing me and telling me that anything is possible.',NULL,0,0,1,1);
