2017/18 Top Mark in Three Classes','My personal role model is my father, Mike LaPlante. I give him as much credit for the player I am today, as I do myself. The countless sacrifices he has made to push me outside my comfort, to better my weaknesses in addition to the untold hours of driving, feedback and support that he has provided me with, are things he has provided me with that I will forever be grateful for. I idolize the knowledge and passion he has for the game of hockey, and the amazing job he has done to raise me not only as an excellent hockey player, but an excellent person as well. Without his impact, I would not be the player I am today, who is playing before you in the 2019 Canada Winter Games.','I got involved with hockey later than most, at the age of 8. It was one spring afternoon, on an outdoor rink, playing shinny with a group of other young kids, that I found my love and passion for hockey. Ever since that day, my love and passion has grown stronger, and has been my drive to become the player I am today, and continue to get exceed my own abilities as a player.',NULL,1,0,0,1);
Athlète de l’année du club JUDOKAN
2012-2013
2013-2014
2015-2016
2017-2018','Mon inspiration c’est mon frère: Jérémie Lapointe. Lui aussi, il est un judoka. Il a toujours travaillé fort pour atteindre ses buts, tout en trouvant du temps pour être avec sa famille et ses amis. Il est aussi très déterminé et quand il veut quelque chose, il n’a pas peur de mettre le travail nécessaire. Jérémie c’est mon modèle parce que c’est mon frère et même si parfois je suis dans son ombre, il m’aide beaucoup à m’améliorer et il me motive à continuer à travailler fort.','J’ai été introduite au sport par mon frère Jérémie. Je me souviens très bien du jour où j’ai décidé d’essayer le judo. Mon frère participait à une compétition régionale à Port-Cartier. Donc, je suis allée l’encourager. Ce sport a tout de suite piqué ma curiosité. La saison suivante, j’étais sur les tapis prête à apprendre le judo. J’ai adoré ce sport, je pouvais bouger et dépenser de l’énergie. Ma mère n’était pas certaine que j’allais aimer la compétition, mais j’ai aimé cela. Un an après avoir commencé le judo, j’ai été diagnostiquée avec une maladie nommée le lupus. Le lupus est une maladie du système immunitaire et si ce n’est pas bien contrôlé, cela cause beaucoup de la douleur articulaire et de la fatigue chronique. Après mon diagnostique, mes médecines m’ont dit que je ne pouvais plus faire de judo, ni d’activité physique. J’ai tout de suite regardé ma mère pour lui dire qu’il n’était pas question que j’arrête le judo. Je venais de commencer à compétitionner. J’aimais beaucoup trop cela, je ne pouvais pas me faire à l’idée de quitter ce sport. Cela a été un long processus de trouver la bonne médication et les bonnes techniques pour gérer ma maladie. Aujourd’hui, heureusement ma maladie est bien contrôlée, mais il arrive que parfois la douleur revienne et que je sois extrêmement fatiguée. Cette maladie arrive par crise. Je peux être bien pour deux semaines et après être trop épuisée pour aller faire des entraînements et même aller à l’école. Je ne vais pas laisser la maladie m’empêcher de faire les choses que j’aime, même si parfois c’est difficile.',NULL,0,0,2,2);
